import React from 'react'
import './Home.css'
import BuyCard from 'components/Controllers/BuyCard'
import styled from 'styled-components'
import { ConnectWalletModal } from 'components/Views/Modals/ConnectWalletModal'

const Home = () => {
  return (
    <>
      <MainContainer>
        <BuyCard />
      </MainContainer>
      <ConnectWalletModal />
    </>
  )
}

const MainContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`

export default Home
